function add_budget_data(label_hover, total_X , total_Y , department_X , department_Y , budget_Y_1 , budget_Y , department , discretion){
  var discretion = discretion || true ;
  if(discretion){
    discretion = 'Discretionary' ;
  }else{
    discretion = 'Mandatory' ;
  }

  nytg.budget_array_data.push(
    {
      "name":label_hover,
      "positions":{
        "total":{
          "x": total_X,
          "y": total_Y
        },
        "department":{
          "x": department_X,
          "y": department_Y
        }
      },
      "id":550,
      "budget_2012":budget_Y_1,
      "change": (budget_Y - budget_Y_1) / budget_Y_1,
      "budget_2013": budget_Y,
      "department": department,
      "discretion":discretion
    }
  );
}
var category_datas = {} ;
var tata = [];
recoverCategorie() ;



function recoverCategorie(){
  nytg.budget_array_data.map(function(budget){

    if(budget.department.split(':').length > 1){
        budget.department = budget.department.split(':')[1];
    }else{
      budget.department = budget.department.split(':')[0];
    }
    if(category_datas[budget.department]) {
      category_datas[budget.department].budget += budget.budget_2013 ;

    }else{
      category_datas[budget.department]={
        'label' :budget.department ,
        'budget': budget.budget_2013
      };
    }
  });

  for (category_data in category_datas){
    tata.push({
          "label":"Category: " + category_datas[category_data].label,
          "category":category_datas[category_data].label,

        "total":category_datas[category_data].budget,
        "num_children":24,
        "short_label": category_datas[category_data].label
      });
  }

}

